import NavLink from "../Components/NavLink/NavLink";
import {
  MyLink,
  MyButton,
  CoolTitle,
  Section,
  DangerButton,
} from "../Components/StyledComponents/styledComponents";

const RedLink = styled.input.attrs((props) => ({
  type: "number",
  size: 100,
  placeholder: "Your number",
}))`
  color: red;
  text-decoration: none;
  ${(props) =>
    props.fucker &&
    css`
      color: purple;
      padding: 0.3rem;
      outline: none;
      border-width: 1px;
      ::-webkit-inner-spin-button,
      ::-webkit-outer-spin-button {
        -webkit-appearance: none;
      }
      ::placeholder {
        color: purple;
      }
      &:focus {
        border-color: red;
        border-width: 1px;
        padding: 0.3rem;
      }
    `}
`;

